export default function Details() {
  return (
    <>
      <div className="w-full h-[935px] bg-[linear-gradient(179.22deg,#E5F5FF_16.4%,#8BD1FF_60.42%,#E5F5FF_97.72%)] flex justify-center items-end relative mb-6">
        <div className="w-[90%] h-[90%] "></div>
        <img
          src="./trust.png"
          className="w-[340px] absolute bottom-0 left-20 z-10"
        />
        
        {/* Bottom trapezoid */}
        <div className="w-full h-[250px] bg-gradient-to-r from-blue-200 to-blue-400 [clip-path:polygon(0%_0%,100%_0%,100%_90%,95%_100%,5%_100%,0%_90%)]">
        </div>
      </div>
    </>
  );
}
